  const handleBackClick = () => {
    history.push('/');
  };
  return (
    <div>
      <h2>Tasks Shown</h2>
      <button onClick={handleBackClick}>Zur√ºck zur Hauptseite</button>
      {tasks.length === 0 ? (
        <p>Keine Aufgaben gefunden.</p>
      ) : (
        <TaskList 
          tasks={tasks} 
          onDeleteTask={onDeleteTask}
          onUpdateTask={onUpdateTask}
        />
      )}
    </div>
  );
};
export default TasksShownPage;
